<!DOCTYPE html>
<html lang="en">

<head>
    <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons">
    <link rel="stylesheet" href="https://code.getmdl.io/1.3.0/material.indigo-pink.min.css">
    <script defer src="https://code.getmdl.io/1.3.0/material.min.js"></script>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Dock</title>
    <style>
        body {
            margin: 0px;
            overflow: hidden;
        }

        e.bdock {
            width: 100%;
            height: 64px;
            position: absolute;
            bottom: 0px;
        }

        e.bdock:hover {}

        s.bdockgradient {
            opacity: 0.15;
            display: block;
            width: 100%;
            height: 12px;
            position: absolute;
            bottom: 64px;
            background: rgb(0, 0, 0);
            background: linear-gradient(0deg, rgba(0, 0, 0, 1) 0%, rgba(0, 0, 0, 0) 100%);
        }

        .pbtnbdock {
            left: 12px;
            font-size: 84px;
            top: -32px;
            position: relative;
            color: crimson;
            border-radius: 100%;
            user-select: none;
            transition: padding 0.6s, margin 0.6s;
            background-color: #ffffff;
            padding: 0px;
        }

        .pbtnbdock:hover {
            transform: scale(1);
            background-color: crimson;
            padding: 110%;
            margin: -110%;
        }

        img {
            width: 48px;
            position: absolute;
            left: 8px;
            top: 8px;
            transition: all 0.2s;
            background-color: #c62828;
            border-radius: 100%;
            backdrop-filter: blur(8px);
        }

        img:active {
            transform: scale(1.15);
            background-color: #c62828;
        }

        .slider {
            -webkit-appearance: none;
            appearance: none;
            width: calc(100% - 192px);
            height: 4px;
            background: #C62828;
            outline: none;
            opacity: 1;
            transition: opacity .2s;
            position: relative;
            z-index: 1000;
            top: 18px;
            left: 64px;
            user-select: none;
            border-radius: 2px;
        }

        /* Mouse-over effects */
        .slider:hover {
            opacity: 1;
            /* Fully shown on mouse-over */
        }

        /* The slider handle (use -webkit- (Chrome, Opera, Safari, Edge) and -moz- (Firefox) to override default look) */
        .slider::-webkit-slider-thumb {
            -webkit-appearance: none;
            /* Override default look */
            appearance: none;
            width: 20px;
            /* Set a specific slider handle width */
            height: 20px;
            /* Slider handle height */
            background: #C62828;
            /* Green background */
            cursor: pointer;
            /* Cursor on hover */
            border-radius: 100%;
            transition: all .2s;
            border-style: solid;
            border-color: #ffffff;
            border-width: 0px;
        }

        .slider::-webkit-slider-thumb:active {
            transform: scale(1.6);
            border-width: 2px;
        }

        p.timer {
            position: absolute;
            left: calc(100% - 114px);
            color: #4e4e4e;
        }
    </style>
</head>

    <script>
        
        function togglePlay() {
            if (document.getElementById("ppButton").getAttribute("src") === "/assets/dock/playBtnBar.svg") {
                document.getElementById("audioElement").play()
                document.getElementById('ppButton').setAttribute('src', '/assets/dock/pauseBtnBar.svg')
            } else {
                document.getElementById("audioElement").pause()
                document.getElementById('ppButton').setAttribute('src', '/assets/dock/playBtnBar.svg')
            }
            scrub();

        }

        function n(n) {
            return n > 9 ? "" + n : "0" + n;
        }
        function scrub() {
            sync();
            document.getElementById("scrubber").setAttribute("max", Math.floor(document.getElementById("audioElement").duration))
            document.getElementById("audioElement").currentTime = document.getElementById("scrubber").value;
        }

        function sync() {
            document.getElementById("scrubber").value = document.getElementById("audioElement").currentTime;
            setTimeout(sync, 100);
        }

        function syncTimer() {
            document.getElementById("timer").innerHTML = String(Math.floor(document.getElementById("audioElement").currentTime / 60)) + ":" + String(n(Math.floor(document.getElementById("audioElement").currentTime) - Math.floor(document.getElementById("audioElement").currentTime / 60) * 60)) + " / " + String(Math.floor(document.getElementById("audioElement").duration / 60)) + ":" + String(n(Math.floor(document.getElementById("audioElement").duration) - Math.floor(document.getElementById("audioElement").duration / 60) * 60));
            setTimeout(syncTimer, 100);
        }
    </script>
    <s class="bdockgradient"></s>
    <e class="bdock">
        <input type="range" min="0" max="2000" value="0" tabindex="0" class="slider" id="scrubber" onmouseup="scrub()"
            onmousedown="clearTimeout(sync)">
        <p class="timer" id="timer">3:15 / 5:50</p>
        <img src="/assets/dock/playBtnBar.svg" alt="" id="ppButton" onclick="togglePlay()">
    </e>
